import React from 'react';
import PropTypes from 'prop-types';

import Button from '../Button/Button';
import './Task.scss'

const Task = ({ clicked }) => {
    return (
        <div className='task'>
            <h3>Пользователь может добавлять новые задачи в список</h3>
            <Button clicked={clicked}>

            </Button>
        </div>
    );
};

Task.propTypes = {
    clicked: PropTypes.func
};

export default Task;
